insert into nestedkeyvalue VALUES ('O_PQREF_635c59-1.0.0-Description-def', 'O_PQREF_635c59-1.0.0-Description', 'Ezzel a kiegészítő adatopcióval további 300MB adat áll rendelkezésedre a tarifádban foglalt adatmennyiségeden felül 750 Ft-ért, melyet számlazárásig tudsz felhasználni, a tarifádban foglalt adatra irányadó, azonos feltételekkel. Ha MultiNet Supreme szolgáltatással is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!'); 
insert into nestedkeyvalue VALUES ('O_PQREF_635c59-1.0.0-Description-eng', 'O_PQREF_635c59-1.0.0-Description', 'Ezzel a kiegészítő adatopcióval további 300MB adat áll rendelkezésedre a tarifádban foglalt adatmennyiségeden felül 750 Ft-ért, melyet számlazárásig tudsz felhasználni, a tarifádban foglalt adatra irányadó, azonos feltételekkel. Ha MultiNet Supreme szolgáltatással is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!'); 
