insert into nestedkeyvalue VALUES ('66975-1.0.0-Description-def', '66975-1.0.0-Description', 'Ezzel a kiegészítő adatopcióval 300MB osztható adat áll rendelkezésedre minden számlázási ciklusban havi 500 Ft-ért a tarifádban, valamit az Automatikus PluszAdat opciódba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Ha MultiNet Supreme-el is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!  A kiegészítő adatopciót a tarifádban foglalt adat felhasználásával azonos feltételek mellett használhatod.'); 
insert into nestedkeyvalue VALUES ('66975-1.0.0-Description-eng', '66975-1.0.0-Description', 'Ezzel a kiegészítő adatopcióval 300MB osztható adat áll rendelkezésedre minden számlázási ciklusban havi 500 Ft-ért a tarifádban, valamit az Automatikus PluszAdat opciódba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Ha MultiNet Supreme-el is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!  A kiegészítő adatopciót a tarifádban foglalt adat felhasználásával azonos feltételek mellett használhatod.'); 
insert into nestedkeyvalue VALUES ('66975-1.0.0-Description-hun', '66975-1.0.0-Description', 'This extra data pack will give you an additional 300MB of shared mobile internet in each monthly billing period (on top of the data already included in your tariff or Automatikus PluszAdat option) for 500 Ft. It will be activated every month at the start of your billing period so you don't have to worry about purchasing extra data every month - after you run out! In case you have also contracted a MultiNet Supreme tariff, you will be able to share this extra data bundle between both your devices! You can use this extra data pack with the same conditions as your tariff.'); 
