insert into nestedkeyvalue VALUES ('66977-1.0.0-Description-def', '66977-1.0.0-Description', 'Ezzel a kiegészítő adatopcióval 1GB osztható adat áll rendelkezésedre minden számlázási ciklusban havi 1 400 Ft-ért a tarifádban, valamit az Automatikus PluszAdat opciódba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Ha MultiNet Supreme-el is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!  A kiegészítő adatopciót a tarifádban foglalt adat felhasználásával azonos feltételek mellett használhatod.'); 
